import React from 'react';
import Button from '@material-ui/core/Button';
import FreeBreakfastIcon from '@material-ui/icons/FreeBreakfast';
import KeyboardIcon from '@material-ui/icons/Keyboard';
import Grid from '@material-ui/core/Grid';

const App = props => {
	return (
		<>
			<Grid container>
				<Grid container item>
					<Grid item xs={8} className='num1'></Grid>
					<Grid item xs={4} className='num2'>
						<Grid container sapcing={4} item>
							<Grid item xs={4}>
								<Button
									variant='contained'
									className='font'
									startIcon={<KeyboardIcon />}
								>
									انجام پروژه
								</Button>
							</Grid>
							<Grid item xs={4}>
								<Button
									variant='contained'
									className='font'
									startIcon={<FreeBreakfastIcon />}
								>
									سفارش تایپ
								</Button>
							</Grid>
						</Grid>
					</Grid>
				</Grid>
			</Grid>
		</>
	);
};

export default App;
